/*
 * @Author: your name
 * @Date: 2022-04-11 16:13:26
 * @LastEditTime: 2022-04-16 16:59:13
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage-test\src\layouts\FlowManage\Sidebar.js
 */
import React from 'react';
import { Divider, Tag } from 'antd';
import {
  TwitterOutlined,
  FormOutlined,
  FacebookOutlined,
  LinkedinOutlined,
} from '@ant-design/icons';

export default () => {
  const onDragStart = (event, nodeType) => {
    event.dataTransfer.setData('application/reactflow', nodeType);
    event.dataTransfer.effectAllowed = 'move';
  };

  return (
    <div>
      <Tag icon={<FormOutlined />} color="#55acee">
        <div  onDragStart={(event) => onDragStart(event, 'node1')} draggable>
          流程节点
        </div>
      </Tag>
      <Tag icon={<TwitterOutlined />} color="#55acee">
        <div  onDragStart={(event) => onDragStart(event, 'node1')} draggable>
          抄送节点
        </div>
      </Tag>
      <Divider type="vertical" />

    </div>
  );
};
